const User = ({name, age}) => {
  return (
    <div className={'user-container'}>
      <h1>{name}</h1>
      <p>Age: {age}</p>
      <style jsx>{`
        .user-container {
          padding: 20px;
          text-align: center;
        },
        div {
          border: 1px solid #eee;
          box-shadow: 0 2px 3px #ccc;

        }
      `}
      </style>
    </div>
  )
}

export default User
